snippet.textDisplay:
@SheetalRoom
2 weeks ago
মা লো মা - দেহতত্ত্ব বিষয়ক গান। মানুষ আস্তে আস্তে বড় হয়। মায়ের কোল থেকে নেমে জীবনকে বুঝতে চায়। একসময় দেহে যৌবন আসে। এরপর বার্ধক্য।এই গানের কথায় "বেহুলা লক্ষীন্দর" এর কাহিনি যুক্ত হয়েছে। গানে ভাঙ্গা নৌকা বলতে জীবনকে এবং গাঙ্গে বলতে দুনিয়া ও সময়কে বোঝানো হয়েছে। রবীন্দ্রনাথ ঠাকুরের সোনার তরী কবিতার মূলভাব আর এই গানের মূলভাব কিছুটা একই। সময়ের সাথে তাল মিলিয়ে গানটি আমাদের সামনে আনার জন্য ধন্যবাদ কোক স্টুডিও বাংলা টিমকে। জাস্ট ওয়াও সৃষ্টি।।। এই গানটা মূলত হচ্ছে রশিদ উদ্দিনের আর প্রচার করা হয়েছে খালেক দেওয়ানের নামে , রুচির দুর্ভিক্ষ চলাকালীন সময়েও এইসব গানের শিল্পী এবং শ্রোতাদের রুচির প্রতি সম্মান জানাই

